178.body:
Use gget ref en combinación con kallisto | bustools para construir un índice de referencia: kb ref -i INDEX -g T2G -f1 FASTA $(gget ref --ftp -w dna,gtf homo_sapiens) → kb ref crea un índice de referencia utilizando los últimos archivos de ADN y GTF de especies Homo sapiens que le ha pasado gget ref. Enumere todos los genomas disponibles de la versión 103 de Ensembl: gget ref --list_species -r 103 # Python
gget.ref(species=None, list_species=True, release=103) → Regresa una lista con todos los genomas disponibles (gget ref verifica si GTF y FASTA están disponibles) de la versión 103 de Ensembl. (Si no se especifica ninguna versión, gget ref siempre devolverá información de la última versión de Ensembl). Obtenga la referencia del genoma para una especie específica: gget ref -w gtf,dna homo_sapiens # Python
gget.ref("homo_sapiens", which=["gtf", "dna"]) → Regresa un JSON con los últimos FTP humanos GTF y FASTA, y sus respectivos metadatos, en el formato: { "homo_sapiens": { "annotation_gtf": { "ftp": "http://ftp.ensembl.org/pub/release-106/gtf/homo_sapiens/Homo_sapiens.GRCh38.106.gtf.gz", "ensembl_release": 106, "release_date": "28-Feb-2022", "release_time": "23:27", "bytes": "51379459" }, "genome_dna": { "ftp": "http://ftp.ensembl.org/pub/release-106/fasta/homo_sapiens/dna/Homo_sapiens.GRCh38.dna.primary_assembly.fa.gz", "ensembl_release": 106, "release_date": "21-Feb-2022", "release_time": "09:35", "bytes": "881211416" } }
} Más ejemplos

75.body:
Get the genome reference for a specific species: gget ref -w gtf,dna homo_sapiens # Python
gget.ref("homo_sapiens", which=["gtf", "dna"]) → Returns a JSON with the latest human GTF and FASTA FTPs, and their respective metadata, in the format: { "homo_sapiens": { "annotation_gtf": { "ftp": "http://ftp.ensembl.org/pub/release-106/gtf/homo_sapiens/Homo_sapiens.GRCh38.106.gtf.gz", "ensembl_release": 106, "release_date": "28-Feb-2022", "release_time": "23:27", "bytes": "51379459" }, "genome_dna": { "ftp": "http://ftp.ensembl.org/pub/release-106/fasta/homo_sapiens/dna/Homo_sapiens.GRCh38.dna.primary_assembly.fa.gz", "ensembl_release": 106, "release_date": "21-Feb-2022", "release_time": "09:35", "bytes": "881211416" } }
} List all available genomes from Ensembl release 103: gget ref --list_species -r 103 # Python
gget.ref(species=None, list_species=True, release=103) → Returns a list with all available genomes (checks if GTF and FASTAs are available) from Ensembl release 103. (If no release is specified, gget ref will always return information from the latest Ensembl release.) Use gget ref in combination with kallisto | bustools to build a reference index: kb ref \ -i index.idx \ -g t2g.txt \ -f1 fasta.fa \ $(gget ref --ftp -w dna,gtf homo_sapiens) → kb ref builds a reference index using the latest DNA and GTF files of species Homo sapiens passed to it by gget ref. More examples
